import React, { Component } from 'react'

class Search extends Component {
    state = {
        user: ''
    }



    getByName = (e) => {
        e.preventDefault();
        console.log(this.state.user)
        this.props.getByName(this.state.user);
    }

    render() {

        return (
            <div className="container row">
                <div className="col-md-6">
                    <form onSubmit={(e) => this.getByName(e)}>

                        <div className="form-group">
                            <label>Name</label>
                            <input
                                type="text"
                                className="form-control"
                                value={this.state.user}
                                onChange={(e) => this.setState({ user: e.target.value })}
                            />
                        </div>

                        {/* <div className="form-group">
                            <label>Email</label>
                            <input
                                type="text"
                                className="form-control"
                            />
                        </div> */}

                        <button type="submit" className="btn btn-primary">Search</button>

                    </form>
                </div>
                <div className="col-md-6">
                    {this.props.searchResult &&
                        // <h1>{this.props.searchResult.name}</h1>
                        <table className="table table-hover">
                            <thead>
                                <tr>
                                    <th>Name</th>
                                    <th>Email</th>
                                    <th>Vehicle</th>
                                </tr>
                            </thead>
                            <tbody>
                                <tr>
                                    <td>{this.props.searchResult.name}</td>
                                    <td>{this.props.searchResult.email}</td>
                                    <td>{this.props.searchResult.vehicle}</td>
                                </tr>
                            </tbody>
                        </table>
                    }
                </div>
            </div>
        )
    }
}

export default Search;
